//libraries
import React from 'react';

//components
import Heading2 from '../../UI/Headings/Heading2';
import ListItem from '../../UI/List/ListItem';

const Home_2 = () => (
  <section>
    <Heading2>Leczone schorzenia</Heading2>
      <ul>
        <ListItem>Bóle kręgosłupa</ListItem>
        <ListItem>Wady postawy</ListItem>
        <ListItem>Skolioza</ListItem>
        <ListItem>Dyskopatia</ListItem>
        <ListItem>Zespół bolesnego barku</ListItem>
        <ListItem>Płaskostopie</ListItem>
        <ListItem>Stwardnienie rozsiane</ListItem>
        <ListItem>Zespół cieśni</ListItem>
        <ListItem>Zwyrodnienie stawów</ListItem>
        <ListItem>Reumatoidalne zapalenie stawów</ListItem>
        <ListItem>Ostroga piętowa</ListItem>
        <ListItem>Kontuzje sportowe</ListItem>
        <ListItem>Stany pooperacyjne</ListItem>
      </ul>
  </section>
   
)
export default Home_2;
